import React from 'react';
import Card from '../Card/Card';
import Title from '../Title/Title';
import image1 from './images/image1.jpg';
import image2 from './images/image2.jpg'
import './CardsSection.scss';
import Type from './../Type/Type';

const CardsSection = () => {
  return (
    <>
      <section className='wrapper'>
          <Title text={'Cards'}/>
          <div className='cards__container'>
            <Card  image={image1} title={'Emboar'} generation={'5'} type={<><Type className={'type-fighting'} text={'Fighting'}/><Type text={'Fire'} /> </>}/>
            <Card  image={image2} title={'Darkrai'} generation={'4'} type={<><Type text={'Dark'} /></>}/>
            <Card  image={image1} title={'Diggersby'} generation={'5'} type={<><Type text={'Normal'} /><Type text={'Ground'} /> </>}/>
          </div>
      </section>
     
    </>
  );
}

export default CardsSection;
